import React, { useState, useEffect } from 'react';
import { BrowserRouter, Routes, Route, useNavigate, Link } from 'react-router-dom';
import './App.css';
import SearchForm from './components/SearchForm';
import HotelList from './components/HotelList';
import AdminPanel from './components/AdminPanel';
import LoginForm from './components/LoginForm';
import RegisterForm from './components/RegisterForm';

const AppContent = () => {
  const [hotels, setHotels] = useState([]);
  const [currentUser, setCurrentUser] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (token) {
      fetchUserData(token);
    }
  }, []);

  const fetchUserData = async (token) => {
    try {
      const response = await fetch('http://localhost:8000/users/me', {
        headers: {
          'Authorization': `Bearer ${token}`
        }
      });
      if (response.ok) {
        const user = await response.json();
        setCurrentUser(user);
      }
    } catch (error) {
      console.error('Kullanıcı bilgileri alınamadı:', error);
    }
  };

  const handleSearch = async ({ city }) => {
    try {
      const response = await fetch(`http://localhost:8000/hotels?city=${encodeURIComponent(city)}`);
      if (!response.ok) throw new Error('Otel bilgileri alınamadı');
      const data = await response.json();
      setHotels(data);
    } catch (error) {
      console.error('Hata:', error);
      setHotels([]);
    }
  };

  const handleLogout = () => {
    localStorage.removeItem('token');
    setCurrentUser(null);
    navigate('/');
  };

  return (
    <div className="App">
      <header className="app-header">
        <h1 className="app-title">Otel Rezervasyon Sistemi 🏨</h1>

        <div className="auth-section">
          {currentUser ? (
            <div className="user-info">
              <span className="welcome-msg">Hoş geldiniz, {currentUser.full_name || currentUser.email}</span>
              {currentUser.is_admin && (
                <button className="nav-btn admin-btn" onClick={() => navigate('/admin')}>
                  Admin Paneli
                </button>
              )}
              <button className="nav-btn logout-btn" onClick={handleLogout}>
                Çıkış Yap
              </button>
            </div>
          ) : (
            <div className="auth-buttons">
              <Link to="/login" className="nav-btn login-btn">
                Giriş Yap
              </Link>
              <Link to="/register" className="nav-btn register-btn">
                Kayıt Ol
              </Link>
            </div>
          )}
        </div>
      </header>

      <main className="main-content">
        <Routes>
          <Route path="/" element={
            <>
              <SearchForm onSearch={handleSearch} />
              <HotelList hotels={hotels} />
            </>
          } />
          <Route path="/admin" element={
            currentUser?.is_admin ? (
              <AdminPanel currentUser={currentUser} />
            ) : (
              <div className="unauthorized">
                <h2>Yetkisiz Erişim</h2>
                <p>Bu sayfayı görüntüleme yetkiniz yok.</p>
              </div>
            )
          } />
          <Route path="/login" element={<LoginForm />} />
          <Route path="/register" element={<RegisterForm />} />
        </Routes>
      </main>
    </div>
  );
};

const App = () => {
  return (
    <BrowserRouter>
      <AppContent />
    </BrowserRouter>
  );
};

export default App;
